import { useEffect } from "react";
import { Cookies, useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";
import ShopperSignout from "../Shopper-Signout/shopper-signout";

// import electronics from "/electronics.jpg";
// import mensClothing from "/mens-clothing.jpg";
// import womensClothing from "/womens-clothing.jpg";
// import jewellery from "";

export function ShopperHome() {
  const [cookies, setCookie, removeCookie] = useCookies(["user"]);
  const navigate = useNavigate();

  return (
    <div className="container-fluid">
      <div>
        <div className="d-flex justify-content-between">
          <h4>Hello ! - {cookies["userId"]}</h4>
        </div>
        <div className="d-flex justify-content-between">
          <div>
            <img
              alt="electronics"
              src="/src/electronics.jpg"
              style={{ width: "200px", height: "300px" }}
            />
          </div>
          <div>
            <img
              alt="men's clothing"
              src="/src/men's clothing.jpg"
              style={{ width: "200px", height: "300px" }}
            />
          </div>
          <div>
            <img
              alt="women's clothing"
              src={womensClothing}
              style={{ width: "200px", height: "300px" }}
            />
          </div>
          <div>
            <img
              alt="jewellery"
              src={jewellery}
              style={{ width: "200px", height: "300px" }}
            />
          </div>
        </div>
      </div>
    </div>
  );
}
